import React, { useState } from "react";

let places = [
  { name: "Kiev", zip: "703448" },
  { name: "Kharkiv", zip: "706483" },
  { name: "Odessae", zip: "698740" },
  { name: "Dnipro", zip: "709930" },
  { name: "Santa Cruz", zip: "95062" },
];

const Places = (props) => {
  return (
    <div>
      {/* <p>дочерний элемент = {props.place.place}</p> */}
      {/* <p>дочерний элемент zip = {props.place.zip}</p> */}
      {places.map((place, index) => {
        return (
          <div>
            <button
              key={index}
              onClick={() => {
                props.newPlace({ place: place.name, zip: place.zip });
              }}
            >
              {place.name}
            </button>
          </div>
        );
      })}
    </div>
  );
};

export default Places;
